import React from 'react'

import { useFormik } from 'formik'

import { Button, FormLabel, TextField } from '@mui/material'

const validationSchema = yup.object({
  email: yup
    .string('Enter your email')
    .email('Enter a valid email')
    .required('Email is required'),
  password: yup
    .string('Enter your password')
    .min(8, 'Password should be of minimum 8 characters length')
    .required('Password is required'),
});

const ComplexInformations = (props) => {

    const formik = useFormik({
        initialValues: {
            complex: {
                complex_name: '',
                house_number: '',
                city: '',
                postal_code: '',
                phone_number: '',
                email_address: '',
                street: '',
                house_number_extension: '',
                country: '',
                phone_number_landcode: '',
                opening_hours: '',
                complex_facility_type: {
                    kitchen: '',
                    bathroom: '',
                    supermarket: '',
                    fitness: '',
                    common_room: '',
                    reception_office: '',
                    laundry: '',
                    relax: ''
                }
            }
        },
        /* validationSchema: validationSchema, */
        onSubmit: (data) => {
            console.log(data)
            props.next(data)
        }
    })

    return (
        <>
            <div>
                <form onSubmit={formik.handleSubmit}>

                    <FormLabel component='legend' style={{ color: 'black', marginBottom: '10px'}}>Complex name</FormLabel>
                    <TextField
                        name='complex.complex_name'
                        value={formik.values.complex.complex_name}
                        onChange={formik.handleChange}
                        /* error={formik.touched.complex.complex_name && Boolean(formik.errors.complex.complex_name)}
                        helperText={formik.touched.complex.complex_name && formik.errors.complex.complex_name} */
                    />

                    <Button color='primary' variant='contained' fullWidth type='submit'>
                        Submit
                    </Button>
                </form>
            </div>
        </>
    )
}

export default ComplexInformations
